  [],\n\t\"revision_timestamp\": \"2015-05-07T05:57:44.821870\",\n\t\"name\": \"wake-vortex-lidar-monte-carlo-simulation-and-visualization-tool-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Light Detection and Ranging (LIDAR) sensors
  have been successfully demonstrated and implemented capabilities to detect and measure
  wake vortices in and around the terminal area.   Although LIDAR systems have been
  used to measure wake vortex strength and position in NASA and FAA measurement campaigns
  and too little is known about their accuracy in quantifying location and strength
  in different regimes. Field data analysis suggests that strength may be commonly
  overestimated compared to theoretical models, but no study has been conducted to
  determine the validity and accuracy of the sensing techniques to determine these
  estimates.   Additionally, these uncertainties cannot be determined since no other
  remote sensing system has been verified to accurately measure and characterize the
  wake vortices.  A risk with no quantitative assessment is that it may negatively
  impact the separation standards.rnrnAerospace Innovations, LLC proposes to design
  and develop a physics-based Monte Carlo LIDAR Simulation and Visualization (LiSiVi)
  Tool to provide NASA and industry researchers the ability to accurately model the
  performance of LIDAR based wake vortex sensing systems.  The significance of this
  innovation is that it combines the advancement of knowledge in the wake vortex modeling
  research and the laser technology areas.  rn\",\n\t\"license_title\": \"U.S. Government
